def calc_score(p1,p2):
	pk_score = float(type_effectiveness[p1["Type1"]][p2["Type1"]])
	if p2["Type2"]:
			pk_score *= type_effectiveness[p1["Type1"]][p2["Type2"]]
	if p1["Type2"]:
		temp = float(type_effectiveness[p1["Type2"]][p2["Type1"]])
		if p2["Type2"]:
			temp *= type_effectiveness[p1["Type2"]][p2["Type2"]]
		pk_score += temp
		pk_score /= 2
	return round(pk_score,3)
	
def pk_special_winner(pk1, pk2):
	pk1_info = {}
	pk2_info = {}
	pk1_score = 0
	pk2_score = 0
	
	for info in pk_data:
		if info["Number"] == pk1:
			pk1_info = info
		if info["Number"] == pk2:
			pk2_info = info
	
	pk1_score = calc_score(pk1_info, pk2_info)
	pk2_score = calc_score(pk2_info, pk1_info)
	
	if pk1_score == pk2_score:
		return -1
	elif pk1_score > pk2_score:
		return pk1
	else:
		return pk2
	
